import React, { useState, useEffect } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

export default function EditarPet() {
  const { id } = useParams();
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    nome: '',
    raca: '',
    idade: '',
    peso: '',
    porte: '',
    sexo: '',
    cor: '',
    castrado: false,
    carteiraVacinacao: false,
    observacoes: '',
    tutor: '',
    dono: '',
    criador: '',
  });

  const [tutores, setTutores] = useState([]);
  const [donos, setDonos] = useState([]);
  const [admins, setAdmins] = useState([]);

  useEffect(() => {
    api.get(`/pets/${id}`)
      .then((response) => {
        const pet = response.data;
        setFormData({
          ...pet,
          tutor: pet.tutor?._id || '',
          dono: pet.dono?._id || '',
          criador: pet.criador?._id || '',
        });
      })
      .catch((err) => console.error('Erro ao carregar pet:', err));

    api.get('/tutores')
      .then((res) => setTutores(res.data))
      .catch((err) => console.error('Erro ao carregar tutores:', err));

    api.get('/donos')
      .then((res) => setDonos(res.data))
      .catch((err) => console.error('Erro ao carregar donos:', err));

    api.get('/admins')
      .then((res) => setAdmins(res.data))
      .catch((err) => console.error('Erro ao carregar admins:', err));
  }, [id]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    const val = type === 'checkbox' ? checked : value;
    setFormData({ ...formData, [name]: val });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    api.put(`/pets/${id}`, formData)
      .then(() => navigate('/pets'))
      .catch((err) => console.error('Erro ao salvar alterações:', err));
  };

  return (
    <div className="container">
      <Link to="/" className="btn btn-secondary mb-3">← Voltar ao Início</Link>
      <h2>Editar Pet</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Nome:</label>
          <input type="text" className="form-control" name="nome" value={formData.nome} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Raça:</label>
          <input type="text" className="form-control" name="raca" value={formData.raca} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Idade:</label>
          <input type="number" className="form-control" name="idade" value={formData.idade} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Peso (kg):</label>
          <input type="number" className="form-control" name="peso" value={formData.peso} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Porte:</label>
          <input type="text" className="form-control" name="porte" value={formData.porte} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Sexo:</label>
          <select className="form-control" name="sexo" value={formData.sexo} onChange={handleChange}>
            <option value="">Selecione</option>
            <option value="Macho">Macho</option>
            <option value="Femea">Fêmea</option>
          </select>
        </div>
        <div className="form-group">
          <label>Cor:</label>
          <input type="text" className="form-control" name="cor" value={formData.cor} onChange={handleChange} />
        </div>
        <div className="form-check">
          <input type="checkbox" className="form-check-input" name="castrado" checked={formData.castrado} onChange={handleChange} />
          <label className="form-check-label">Castrado</label>
        </div>
        <div className="form-check">
          <input type="checkbox" className="form-check-input" name="carteiraVacinacao" checked={formData.carteiraVacinacao} onChange={handleChange} />
          <label className="form-check-label">Carteira de Vacinação em Dia</label>
        </div>
        <div className="form-group">
          <label>Observações:</label>
          <textarea className="form-control" name="observacoes" value={formData.observacoes} onChange={handleChange}></textarea>
        </div>
        <div className="form-group">
          <label>Tutor:</label>
          <select className="form-control" name="tutor" value={formData.tutor} onChange={handleChange}>
            <option value="">Selecione um tutor</option>
            {tutores.map((t) => (
              <option key={t._id} value={t._id}>{t.nome}</option>
            ))}
          </select>
        </div>
        <div className="form-group">
          <label>Dono:</label>
          <input type="text" className="form-control" value={donos.find(d => d._id === formData.dono)?.nome || ''} readOnly />
        </div>
        <div className="form-group">
          <label>Criador (Admin):</label>
          <input type="text" className="form-control" value={admins.find(a => a._id === formData.criador)?.nome || ''} readOnly />
        </div>
        <button type="submit" className="btn btn-primary mt-3">Salvar Alterações</button>
      </form>
    </div>
  );
}
